I have no published code to show for these changes, but the first commit allows using sip.js as a module using the following code:

```javascript
import * as SIP from 'sip.js';

let ua = new SIP.UA({ ... });
ua.on('registered', () => console.log("SipAccountService: registered"));
ua.on('invite', (session: SIP.Session) => {
    console.log("SipAccountService: invite", session);
    this.setupSession(session);
});
ua.start();

function setupSession(sipSession: SIP.Session) {
}
```

Having this requires having the same namespace as the exported name in the library, hence the switch from `sipjs` to `SIP` as the exported namespace. It also allows merging the objects and interfaces into actual classes.

The second commit fixes declaration and naming of constants as per https://sipjs.com/api/0.7.0/causes/

An upcoming change in Typescript, which will probably arrive in 2.4, adds stricter checking of assignment to 'weak types'. Weak types are ones that consist of nothing but optional properties. The compiler basically gave weak types a pass before, so this change catches a lot of errors. This PR fixes the errors on DefinitelyTyped.

Most of the fixes are straightforward resulting from things like assigning `T -> T[]` , etc. 

One problem is worth noting: classes can no longer implement an all-optional interface without implementing at least one method of the interface. But lots of DT packages use implements-all-optional-interface to indicate that *subclasses* can optionally implement these methods. The fix I used here is to use class-interface merging, so that an interface with the same name extends the all-optional-interface:

```ts
interface C extends Optional { }
class C {
 // ...
}
```

In some cases, switching to an abstract base class might be appropriate, but this fix works for everything without needing extensive knowledge of the package.
